//draws a pixel on the screen
void draw_pixel(int x, int y, short int line_color) {
    *(short *) (pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}
//plots an image given x, y coordinates and an integer image array
void draw_image(int xCoord, int yCoord, int imageArray[], unsigned width, unsigned height)
{
	int i = 0; // index for pixel colours in the image array
	unsigned y, x;
    for (y = 0; y < height; y++) {
        for (x = 0; x < width; x++) {
            int plotX = xCoord + x;
            int plotY = yCoord + y;
			//out of bounds
			if (plotX >= 0 && plotY >= 0 && plotX < 320 && plotY < 240){
                draw_pixel(plotX, plotY, imageArray[i]);
			}
            i++; // switch to the next pixel colour
        }
    }
}

//clears the whole screen by writing black to every pixel
void clear_screen(){
	int x, y;
	for(x = 0; x < RESOLUTION_X; x++){
		for(y = 0; y < RESOLUTION_Y; y++){
			draw_pixel(x,y,	BLACK);
		}
	}
}
//clears all the text
void erase_text() {
    /* assume that the text string fits on one line */
    int y,x;
	for(y=0;y<60;y++){
        for(x=0;x<80;x++){
            int offset = (y << 7) + x;
            *(character_buffer + offset) = 0;
            ++offset;
        }
    }
}

//writes text on the screen
void write_text(int x, int y, char *text_ptr) {
    /* assume that the text string fits on one line */
    int offset = (y << 7) + x;

    while (*(text_ptr)) // while it hasn't reach the null-terminating char in the string
    {
        // write to the character buffer
        *(character_buffer + offset) = *(text_ptr);
        ++text_ptr;
        ++offset;
    }
}

void wait_for_vsync()
{
	volatile int * pixel_buffer_start = (int *)0xFF203020; //pixcel controller
	register int status;
	*pixel_buffer_start = 1; //start the synchronization process
	
	status = *(pixel_buffer_start + 3);
	while((status & 0x01) != 0)
	{
		status = *(pixel_buffer_start + 3);
	}
}

//writes storyline arrays onto the screen with spacing between lines
void write_storyline(char storyline[][80], int x_coord, int y_coord, int size)
{
	int spacing = 2;
	int i;
	for(i = 0; i < size; i++){
		write_text(x_coord, y_coord, storyline[i]);
		y_coord = y_coord + spacing;
	}
}

//draws + writes the text for a screen. Has different options depending on whether the screen is
//a cipher screen or not
void draw_screen(bool cipher_screen, int img_xcoord, int img_ycoord, 
int image[], unsigned img_resx, unsigned img_resy, int text_xcoord, 
char texta[][80], int texta_ycoord, int texta_size, char textb[][80], int textb_ycoord, int textbc_size, 
char textc[][80], int textc_ycoord)
{
	
	if(cipher_screen == true)
	{
		draw_image(img_xcoord, img_ycoord, image, img_resx, img_resy);
		write_storyline(texta, text_xcoord, texta_ycoord, texta_size); //question text
	    write_storyline(textb, text_xcoord, textb_ycoord, textbc_size); //before user text
	}
	
	write_storyline(textc, text_xcoord, textc_ycoord, textbc_size); //after user text
}


int main(){

	/* initialize a pointer to the pixel buffer, used by drawing functions */
	pixel_buffer_start = *pixel_ctrl_ptr;
	clear_screen(); // pixel_buffer_start points to the pixel buffer
	erase_text();
	
	disable_A9_interrupts(); // disable interrupts in the A9 processor
	set_A9_IRQ_stack(); // initialize the stack pointer for IRQ mode
	config_GIC(); // configure the general interrupt controller
	config_KEYs(); // configure pushbutton KEYs to generate interrupts
	enable_A9_interrupts(); // enable interrupts in the A9 processor
	wait_for_vsync();

	//display title screen
	draw_image(0, 0, title_image, RESOLUTION_X , RESOLUTION_Y); //plot the start page
	write_text(25, 52, "Press the [Enter] key to begin");
	currentScreen++;
	
	while(1);
}
